import DetailBox from '../../components/DetailBox';
import pointsLogo from '../assets/pointsIcon.png';
import rewardsIcon from '../assets/rewardsIcon.png';
import "./Dashboard.css";

export default function Dashboard() {
  return(
    <div>

  <div id="main">
    <h2>Dashboard</h2>
    <DetailBox
      class="detail-box"
      logo={pointsLogo}
      />
  </div>
    </div>

  );

}
